// src/components/AnalysisResults.js
import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function AnalysisResults() {
    const location = useLocation();
    const navigate = useNavigate();
    const analysis = location.state?.analysis;

    if (!analysis) {
        return (
            <div className="analysis-results">
                <h2>No Analysis Data Available</h2>
                <p>Please go back to the home page to upload your resume and job description.</p>
                <button onClick={() => navigate('/home')}>Go to Home</button>
            </div>
        );
    }
    
    // Check if trendingSkills exists before trying to access it
    const chartData = analysis?.trendingSkills && {
        labels: analysis.trendingSkills.map(s => s[0]),
        datasets: [
            {
                label: 'Trending Skills in Jobs',
                data: analysis.trendingSkills.map(s => s[1]),
                backgroundColor: 'rgba(54, 162, 235, 0.5)',
                borderColor: 'rgba(54, 162, 235, 1)',
                borderWidth: 1,
            },
            {
                label: 'Your Skills',
                data: analysis.trendingSkills.map(s => analysis.skills.includes(s[0]) ? s[1] : 0),
                backgroundColor: 'rgba(75, 192, 192, 0.5)',
                borderColor: 'rgba(75, 192, 192, 1)',
                borderWidth: 1,
            },
        ],
    };

    const chartOptions = {
      responsive: true,
      plugins: {
        legend: { position: 'top' },
        title: { display: true, text: 'Your Skills vs. Trending Skills' },
      },
    };
    
    const handleGoBack = () => {
         navigate('/home');
    };

    return (
        <div className="analysis-results">
            <h2>Analysis Results</h2>
            <button onClick={handleGoBack}>Go Back</button>
            
            {/* Conditional rendering check */}
            {analysis.trendingCourses && analysis.trendingCourses.length > 0 && (
                <>
                    <h3>Trending Job Certification Courses</h3>
                    <ul>
                        {analysis.trendingCourses.map((course, index) => (
                            <li key={index}>
                                <strong>{course.skill}</strong>: {course.course}
                            </li>
                        ))}
                    </ul>
                    <hr/>
                </>
            )}

            {/* Conditional rendering check */}
            {analysis.trendingSkills && analysis.trendingSkills.length > 0 && (
                <>
                    <h3>Resume Skills vs. Trending Jobs</h3>
                    <p>This chart compares your skills with skills currently in demand based on job market trends.</p>
                    <div style={{ width: '80%', margin: 'auto' }}>
                        <Bar data={chartData} options={chartOptions} />
                    </div>
                    <hr/>
                </>
            )}
            
            {/* Conditional rendering check */}
            {analysis.currentJobs && analysis.currentJobs.length > 0 && (
                <>
                    <h3>Current Job Openings</h3>
                    <ul>
                        {analysis.currentJobs.map((job, index) => (
                            <li key={index}>
                                <strong>{job.title}</strong> at {job.company} - {job.location}
                                <br/>
                                <small>Posted: {job.posted_at}</small>
                                <p>{job.description.substring(0, 150)}...</p>
                                <a href={job.apply_link} target="_blank" rel="noopener noreferrer">Apply Now</a>
                            </li>
                        ))}
                    </ul>
                    <hr/>
                </>
            )}

            <h3>Skills Identified</h3>
            <ul>
                {analysis.skills.map((skill, index) => (
                    <li key={index}>{skill}</li>
                ))}
            </ul>

            <h3>Job Matches</h3>
            {analysis.jobMatches.length > 0 ? (
                <ul>
                    {analysis.jobMatches.map((job, index) => (
                        <li key={index}>
                            <strong>{job.title}</strong>: {job.matchPercentage}% match
                            {job.matchingSkills.length > 0 && (
                                <p>Matching skills: {job.matchingSkills.join(', ')}</p>
                            )}
                        </li>
                    ))}
                </ul>
            ) : (
                <p>No job matches found based on your skills.</p>
            )}
            
            <h3>Skill Gaps</h3>
            {analysis.skillGaps.length > 0 ? (
                <ul>
                    {analysis.skillGaps.map((gap, index) => (
                        <li key={index}>{gap}</li>
                    ))}
                </ul>
            ) : (
                <p>No significant skill gaps found.</p>
            )}

            <h3>Course Recommendations</h3>
            {analysis.recommendations.length > 0 ? (
                <ul>
                    {analysis.recommendations.map((rec, index) => (
                        <li key={index}>
                            <strong>{rec.skill}</strong>: {rec.course}
                        </li>
                    ))}
                </ul>
            ) : (
                <p>No course recommendations at this time.</p>
            )}
        </div>
    );
}

export default AnalysisResults;
